CREATE TABLE transactions (
    Account_Number INTEGER,
    Card_Number FLOAT,
    Open_to_Buy FLOAT,
    Credit_Limit FLOAT,
    Transaction_Amount FLOAT,
    Transaction_Time TEXT,
    Transaction_Date TEXT,
